import React from "react";

export default function Time(props) {
  console.log(props.date);
  let day = props.date.getDay();
  let hour = props.date.getHour();
  let minute = props.date.getMinute();

  return (
    <div className="time">
      <h4>${day}</h4>
      <h4>
        ${hour}:${minute}
      </h4>
    </div>
  );
}
